import React, { Component } from 'react';
import './App.css';
import Dashboard from './component/Dashboard/Dashboard'
import Form from './component/Form/Form'
import Header from './component/Header/Header'




class App extends Component {
  constructor(props) {
    super(props)

    this.state = {                              //Define State
      productName: '',
      productPrice: '',
      image: '',
      addtoInventory: [
        {
          productName: "meerkat",
          productPrice: '500',
          image: "image/jpeg;base64,",
        },
        {
          productName: "The Adam",
          productPrice: '200',
          image: "image/jpeg;base64,",
        },
        {
          productName: "mirkat",
          productPrice: '75',
          image: "image/jpeg;base64,",
        }]
    }


    this.handleNameInput = this.handleNameInput.bind(this)
    this.handlePriceInput = this.handlePriceInput.bind(this)
    this.handleImageInput = this.handleImageInput.bind(this)


  }

  handleNameInput(e) {
    this.setState({
      productName: e.target.value,
    })
  }

  handlePriceInput(e) {
    this.setState({
      productPrice: e.target.value,
    })
  }

  handleImageInput(e) {
    this.setState({
      image: e.target.value,
    })
  }




  render() {

    return (
      <section>
        <div className="App">
          <Dashboard enteries={this.state.addtoInventory}/>
          <Header />
          <Form />
        </div>
        <div>
          <input type="text" name="productName" value={this.state.productName} onChange={this.handleNameInput} placeholder="And the name is?" />
          <input type="text" name="productPrice" value={this.state.productPrice} onChange={this.handlePriceInput} placeholder="Whats your Price?" />
          <input type="text" name="image" value={this.state.image} onChange={this.handleImageInput} placeholder="Add an Image" />
          <button>Cancel</button>
          <button>Add to Inventory</button>
        </div>
      </section>
    )
  }
}

export default App;



